import React from 'react';


export default class Formulaire extends React.Component {
    state = {
        numChoose : null
    }
    render(){
        return(
            <div>
                <form>
                    <p>Entrez un nombre entre 0 et 100 compris : </p>
                    <label>
                        <input type="number"  />
                        <button>Send</button>
                        <button>Restart</button>
                    </label>
                </form>
            </div>
        )
    }
}
